// Import All sofbox component here...
import Loader from './Loader';
import Link from './Link';
import ScrollTop from './ScrollTop';
import ColorCustomizer from './ColorCustomizer';
import AnimationShape from './animationShape';

// Helper components for the Header or Navigations...
import HeaderStyle1 from "./HeaderStyle1";
import HeaderStyle2 from "./HeaderStyle2";

//Helper components for the Topbar components...
import Topbar from './Topbars/Topbar';

// Helper components for the section components...
import SectionBannerStyle1 from './sections/SectionBannerStyle1';
import SectionStyle1 from './sections/SectionStyle1';
import SectionStyle2 from './sections/SectionStyle2';
import SectionStyle3 from './sections/SectionStyle3';
import SectionTitle from './sections/SectionTitle';

// Helper components for the card components...
import CardStyle2 from '../sofbox/cards/CardStyle2';
import CardStyle3 from '../sofbox/cards/CardStyle3';
import CardStyle4 from '../sofbox/cards/CardStyle4';
import CardStyle5 from '../sofbox/cards/CardStyle5';
import CardStyle6 from '../sofbox/cards/CardStyle6';
import CardStyle7 from '../sofbox/cards/CardStyle7';
import CardStyle8 from '../sofbox/cards/CardStyle8';
import CardStyle9 from '../sofbox/cards/CardStyle9';
import CardStyle10 from '../sofbox/cards/CardStyle10';
import CardStyle11 from '../sofbox/cards/CardStyle11';
import PricingCardStyle1 from '../sofbox/cards/PricingCardStyle1';
import PricingCardStyle2 from '../sofbox/cards/PricingCardStyle2';
import PricingCardStyle3 from '../sofbox/cards/PricingCardStyle3';
import PricingCardStyle4 from '../sofbox/cards/PricingCardStyle4';
import FancyCard from '../sofbox/cards/FancyCard';

// Helper components for the client carousal..
import ClientCarousal from './ClientCarousal';

// Helper components for the hero section...
import ParallaxHeroStyle1 from './ParallaxHeroStyle1';

// Helper components for the Contact form..
import ContactForm from './ContactForm';

// Helper components for the Footers.
import FooterMain from '../sofbox/partials/footers/FooterMain';
import FooterStyle1 from '../sofbox/partials/footers/FooterStyle1';
import FooterLogo from '../sofbox/footerComponents/FooterLogo';
import FooterAddress from '../sofbox/footerComponents/FooterAddress';
import FooterLinks from '../sofbox/footerComponents/FooterLinks';
import OfficeDay from '../sofbox/footerComponents/OfficeDay';

// Helper component for the About sections...
import AboutStyle1 from '../sofbox/about/AboutStyle1';

// Helper component for the Wave Button
import Wave from './Waves/WaveStyle1';

// Helper component for the List
import ListStyle1 from './Lists/ListStyle1';

// Export all sofbox components...
export {
    Loader,
    Link,
    ScrollTop,
    ColorCustomizer,
    HeaderStyle1,
    HeaderStyle2,
    Topbar,
    AnimationShape,
    ParallaxHeroStyle1,
    SectionBannerStyle1,
    SectionStyle1,
    SectionStyle2,
    SectionStyle3,
    SectionTitle,
    CardStyle2,
    CardStyle3,
    CardStyle4,
    CardStyle5,
    CardStyle6,
    CardStyle7,
    CardStyle8,
    CardStyle9,
    CardStyle10,
    CardStyle11,
    PricingCardStyle1,
    PricingCardStyle2,
    PricingCardStyle3,
    PricingCardStyle4,
    FancyCard,
    ClientCarousal,
    ContactForm,
    AboutStyle1,
    FooterMain,
    FooterLogo,
    FooterStyle1,
    FooterAddress,
    FooterLinks,
    Wave,
    ListStyle1,
    OfficeDay
}
